import React from 'react';
import './styles.css';

const Footer = () => {

    return (
      <>
        <div className='footer-content'>
            <h2>Universidade Tenológica Federal do Paraná</h2>
            <h3>Suporte ao usuário</h3>
            <p>Utilizar o número do RA precedido da letra "a".</p>
            <p>A senha é a mesma utilizada no Portal do aluno.</p>
        </div>
      </>
    )
  }

export default  Footer;
